        Sub679(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub677(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
